import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { WelcomeComponent } from './welcome/welcome.component';
import { UniversityComponent } from './university/university.component';
import { StudentComponent } from './student/student.component';
import { StudentsignupComponent } from './student/studentsignup/studentsignup.component';
import { UniversitysignupComponent } from './university/universitysignup/universitysignup.component';
import { StudenthomepageComponent } from './homepage/studenthomepage/studenthomepage.component';
import { UniversityhomepageComponent } from './homepage/universityhomepage/universityhomepage.component';
import { UniversitylistComponent } from './list/universitylist/universitylist.component';
import { DegreetypeComponent } from './filter/degreetype/degreetype.component';
import { CourselistComponent } from './list/courselist/courselist.component';
import { CoursesignupComponent } from './course/coursesignup/coursesignup.component';
import { StudentprofileComponent } from './profile/studentprofile/studentprofile.component';
import { EnrolledlistComponent } from './list/enrolledlist/enrolledlist.component';
import { UniversityprofileComponent } from './profile/universityprofile/universityprofile.component';
import { UniversitycourselistComponent } from './list/universitycourselist/universitycourselist.component';
import { Universitycourselist2Component } from './list/universitycourselist2/universitycourselist2.component';
import { CoursedegreetypeComponent } from './filter/coursedegreetype/coursedegreetype.component';
import { EnrolleddetailsComponent } from './list/enrolleddetails/enrolleddetails.component';
import { StarlistComponent } from './list/starlist/starlist.component';
import { UniversityauthGuard } from './gaurd/universityauth.guard';
import { StudentauthGuard } from './gaurd/studentauth.guard';


const routes: Routes = [
  {path : '',component : WelcomeComponent},
  {path : 'welcome',component : WelcomeComponent},

  // University Guard 

  {path : 'university',component : UniversityComponent, canActivate:[UniversityauthGuard]},
 
  {path : 'universitysignup',component :UniversitysignupComponent,  canActivate:[UniversityauthGuard]},
  
  {path : 'universityhomepage',component : UniversityhomepageComponent,  canActivate:[UniversityauthGuard]},
  

 
  {path : 'coursesignup',component : CoursesignupComponent,  canActivate:[UniversityauthGuard]},
  {path : 'courselist',component :CourselistComponent,  canActivate:[UniversityauthGuard] },
  {path : 'universityprofile',component :UniversityprofileComponent,  canActivate:[UniversityauthGuard]},
  {path : 'enrolledlist/:instituteCode',component : EnrolledlistComponent ,  canActivate:[UniversityauthGuard]},
  {path : 'universitycourselist/:instituteCode',component : UniversitycourselistComponent ,  canActivate:[UniversityauthGuard]},
  {path : 'universitycourselist2/:instituteCode',component : Universitycourselist2Component ,  canActivate:[UniversityauthGuard]},
 

  // student Guard 
  {path : 'student',component : StudentComponent ,  canActivate:[StudentauthGuard]},
  {path : 'studentsignup',component : StudentsignupComponent ,  canActivate:[StudentauthGuard]},
  {path : 'studenthomepage',component :StudenthomepageComponent,  canActivate:[StudentauthGuard]},
  {path : 'universitylist',component : UniversitylistComponent,  canActivate:[StudentauthGuard]},
 
  {path : 'degreetypefilter/:degreeType',component : DegreetypeComponent,  canActivate:[StudentauthGuard]},
  {path : 'studentprofile',component : StudentprofileComponent,  canActivate:[StudentauthGuard]},
  {path : 'coursedegreetype/:instituteCode/:degreeType',component : CoursedegreetypeComponent,  canActivate:[StudentauthGuard]},
  {path : 'enrolleddetails/:aadhaarNo', component : EnrolleddetailsComponent,  canActivate:[StudentauthGuard]},
  {path : 'starlist/:aadhaarNo', component : StarlistComponent,  canActivate:[StudentauthGuard]},
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
